import React, {Component} from "react";
import axios from "axios";
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
/* eslint-disable */

class Results extends Component {
    constructor(props) {
		super(props)
		this.state = {
			result: [],
			subslist: []
		}
	}

	
	async componentDidMount() {
		await axios.get(encodeURI("http://127.0.0.1:8000/api/subs/?format=json&subname="
		.concat((this.props.ingredient).toString())
			)).then( 
        response => { 
			var result = response.data; 
			this.setState({ result: result })
            }, 
            (error) => { 
            {alert(error)}; 
            } 
		)
		} 
	

	render() {
		(this.state.result).length > 0  ? () => {(this.setState({subslist : this.state.result[0].subslist}))}: null
		console.log(this.subslist)
		return(
			this.state.result ? (
			<div>
				<List>
					<ListItem>
						<ListItemText primary="hello"/>
					</ListItem>
				</List>	 
            </div>) : (<span>Loading results...</span>)
        )
    }
}

export default Results
